import React, { useEffect, useState } from 'react';
import { getMOLs } from '../services/api';
import Header from '../components/shared/Header';

const MOL = () => {
    const [mols, setMOLs] = useState([]);

    useEffect(() => {
        getMOLs(setMOLs)
    }, []);

    useEffect(() => {
        console.log(mols)
    }, [mols])

    return (
        <>
            <Header heading="МОЛ" />
            <ul>
                {mols.map(mol => (
                    <li key={mol.id}>{mol.фио_мол}</li>
                ))}
            </ul>
        </>
    );
};

export default MOL;
